description:
Adobe Photoshop CS6: Learn by Video

 Photoshop CS6 is an incredibly rich and deep set of tools for editing, optimizing, and retouching images, and also offers some great features for working with text, video, and 3D. In this Learn by Video course (created in partnership with our friends at Peachpit Press), Adobe Certified Expert Kelly McCathran is your guide to the myriad capabilities of Photoshop CS6. You'll learn how to make selections, work with layers and masks, use Adobe Camera Raw, create artistic effects, and much more, including lots of hands-on exercises and projects to help you apply what you've learned. 

